webpackJsonp([0x78f77d7490b3],{7738:function(e,t){e.exports={data:{post:{html:'<p>MamaMaus came home today with an odd smell in her handbag. It turned out to be a hard boiled egg that she intended to have as breakfast on Monday, 4 days ago. The handbag is now in the washing machine.</p>\n<p>However, since she flew twice to Munich and back this week, we can only wonder... is the egg now <a href="http://www.dw-world.de/dw/article/0,2144,2253645,00.html" title="Investigators Find Traces of Radiation on British Planes">contaminated with polonium</a>? And why wasn\'t it confiscated by security (particularly yesterday) as a forbidden liquid?</p>',fields:{title:"Are Eggs Liquids?",date:"30 Nov 2006",url:"https://papascott.de/2006-11-30-are-eggs-liquids/"}}},pathContext:{slug:"/2006-11-30-are-eggs-liquids/",prev:{fields:{title:"Bringing Big Bucks By Blogging",date:"29 Nov 2006",slug:"/2006-11-29-bringing-big-bucks-by-blogging/"}},next:{fields:{title:"Perfect Family Christmas",date:"30 Nov 2006",slug:"/2006-11-30-perfect-family-christmas/"}}}}}});
